import React, { useEffect, useState } from 'react'
import { API } from '../../config';
import { readProducto } from '../../core/apiCore';

function CarritoCard({ productoId }) {
    const [producto, setProducto] = useState([]);
    const [error, setError] = useState(false);

    const loadProductos = () => {
        readProducto(productoId.producto).then(data => {
            if (data.error) {
                setError(data.error)
            } else {
                setProducto(data)

            }
        })
    }
    useEffect(() => {
        loadProductos();
        console.log(producto)
    }, [])

    return (
        <div className='m-4 container bg-black rounded h-64'>
            <img
                className='rounded h-5/6 text-center'
                src={`${API}/producto/photo/${productoId.producto}`}
                alt={productoId.producto} />

        </div>
    )
}

export default CarritoCard
